        width: 190px;
        @media screen and (min-width: 1200px){
            margin-top: 700px;
            transform: translateX(-50%) scale(2);
        }
    }
    #text_3 {
        position: absolute;
        bottom: 3.5rem;
        color: #ffffff;
    }
    #splashes_2 {
        width: 100%;
        min-height: calc(350px + 75vw);
        background-position: 200px 250px;
        position: absolute;
        top: 0;
        left: 0;
        top: 50px;
        background-repeat: space;
        z-index: 1;
        @media screen and (min-width: 1200px) {
            top: 412px;  
            min-height: auto;
            height: 750px;
            background-size: 41vw;
            transform: rotate(-7deg);
            background-position: 202px 94px;
        }
    }
}

#third {
    color: #ffffff; 
    position: relative;
    & > .row,
    #third_img {
        object-fit: contain;
        @include contain();
    } 
    @media screen and (min-width: 1200px) {
        margin-top: 100px;
        #text_3 {
            color: #000000;
            margin-top: 5rem;
            text-align: right;
        }
        #third_img  {
            transform: rotate(-2deg) scale(.9);
            position: relative;
            &::before {
                content: "";
                @include tape-blue();
                top: -70px;
                right: -5px;
                transform: rotate(-15deg);
            }
            &::after {
                content: "";
                @include tape-blue();
                bottom: -40px;
                left: -5px;
            }
        }
    }
    #splashes_color {
        width: 100%;
        height: 406px;
        position: absolute;
        background-position: 32px -33px;
        bottom: -300px;
        background-repeat: space;
        background-size: 41vw;
        transform: rotate(9deg);
    }
}

#fourth {
    position: relative;
    margin-top: 15rem;
    #banner_2_wrapper {
        position: absolute;
        left: 50%;
        transform: translateX(-50%);
        top: -160px;
        #banner_2 {
            position: relative;
            z-index: 1;
            img {
                position: absolute;
                left: 50%;
                transform: translateX(-50%);
                top: 27px;
            }
        }
    }
    #fourth_img {
        object-fit: contain;
        @include contain();
    }
    @media screen and (min-width: 1200px){
        #fourth_img {
            margin-bottom: -5rem;
            z-index: 1;
            transform: rotate(2deg) scale(.9);
            position: relative;
            &::before {
                content: "";
                @include tape-blue();
                top: -70px;
                right: -5px;
                transform: rotate(-20deg);
            }
            &::after {
                content: "";
                @include tape-white();
                bottom: -40px;
                left: -5px;
                transform: rotate(-190deg);
            }
        } 
        #banner_2_wrapper {
            position: static;
            transform: translateY(50%);
            margin-bottom: -70px;
            z-index: 1;
            #banner_2 {
                transform: scale(2);
            }
        }
    }
}

